import React from 'react';

import Alert, { Fade } from 'react-bootstrap/Alert';

const Alerts = ({ alert }) => {
  console.log(alert);
  return (
    <Alert
      show={alert.show}
      variant={alert.type}
      dismissible
      elementType={Fade}
    >
      {alert.msg}
    </Alert>
  );
};

export default Alerts;
